import '../styles/Menu.css';

function Menu() {
  const myData = [
    { text: 'Atlanta', value: 'atl' },
    { text: 'Berlin', value: 'ber'},
    { text: 'Chicago', value: 'chi'},
    { text: 'London', value: 'lon'}
  ];
  return (
    <div className="Menu">
      
        
        <Select
        data={myModel}
        display="inline"
        touchUi={false}
        />
        <p>
          Info
        </p>
        <p>
          Dataset
        </p>
      
    </div>
  );
}

export default Menu;
